import React, { Component } from "react";
import "../../home.css";

class Contact extends Component {
  render() {
    return (
      <div className="flex flex-wrap justify-center tl">
        <div className="br2 ba bw1 b--white mv3 shadow tl ph2 name2">
          <p>
            <span className="mr1 neon">▹ </span>
            <span className="notneon">Email: namanranawat159@gmail.com</span>
          </p>
          <p>
            <span className="mr1 neon">▹ </span>
            <span className="notneon">Instagram: @trademarkedsetups</span>
          </p>
          <p>
            <span className="mr1 neon">▹ </span>
            <span className="notneon">Twitter: @trademarkedsetups</span>
          </p>
        </div>
      </div>
    );
  }
}

export default Contact;
